    {
        &quot;post_id&quot;: 1,
        &quot;post_title&quot;: &quot;SAMR, TPACK, Design Thinking? &ndash; How do I best integrate technology into my practice&quot;,
        &quot;post_content&quot;: &quot;&lt;p&gt;Cyber safety has become embedded within the curriculum and effects students&#039; lives on a daily basis. There are a range of quality resources available which educators can access to support their teaching, including department created teaching resources and templates and resources developed by the eSafety Commissioner. Discover classroom resources, learn how other teachers are approaching this topic with their students and access the best practise framework for Online Safety Education to guide your planning and teaching.&amp;nbsp;&lt;/p&gt;&quot;,
        &quot;post_excerpt&quot;: &quot;There are a number of models which educators can use to help them integrate technology into their pedagogy.  The key is to make a start and recognise what you are currently doing and where you would like technology integration to take you.&quot;,
        &quot;author&quot;: &quot;Digital Adoption Group&quot;,
        &quot;cover_image&quot;: &quot;uploads/advice/edSpark-advice-classroom.jpg&quot;,
        &quot;template&quot;: null,
        &quot;extra_content&quot;: [
            {
                &quot;data&quot;: {
                    &quot;template&quot;: &quot;App\\Filament\\PageTemplates\\Advice\\Numbereditems&quot;,
                    &quot;extra_content&quot;: {
                        &quot;numbereditems&quot;: {
                            &quot;item&quot;: [
                                {
                                    &quot;icon&quot;: &quot;heroicon-o-microphone&quot;,
                                    &quot;content&quot;: &quot;&lt;p&gt;Educators can access a range of high-quality resources to guide their planning and teaching. Educators can access resources around Cyber safety which are embedded in the Keeping Safe: Child Protection Curriculum and can be accessed through: KS:CPC website(KS:CPC login required). The eSafety Commissioner has a wide range of resources to support teachers based on the most up to date information, guidelines and thinking. This website includes engaging videos which you can use with your students.&amp;nbsp;&lt;/p&gt;&quot;,
                                    &quot;heading&quot;: &quot;Accessing Planning Resources&quot;
                                },
                                {
                                    &quot;icon&quot;: &quot;heroicon-o-speakerphone&quot;,
                                    &quot;content&quot;: &quot;&lt;p&gt;Cyber safety is part of the general capability &ndash; Digital literacy. It is one of the four key areas: Practising digital safety and wellbeing, and includes three sub elements:&amp;nbsp;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;manage online safety&amp;nbsp;&lt;/li&gt;&lt;li&gt;manage digital privacy and identity&amp;nbsp;&lt;/li&gt;&lt;li&gt;manage digital wellbeing.&amp;nbsp;&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;As such is it responsibility of all teachers to integrate Cyber safety into their teaching. There are opportunities for educators to weave this into their teaching whenever they ask students to use online tools, contribute to their digital footprint and develop heathy online habits.&amp;nbsp;&lt;/p&gt;&quot;,
                                    &quot;heading&quot;: &quot;Linking teaching to the Australian Curriculum&quot;
                                },
                                {
                                    &quot;icon&quot;: &quot;heroicon-s-fire&quot;,
                                    &quot;content&quot;: &quot;&lt;p&gt;&lt;br&gt;Schools and educators can adapt the cyber safety user agreements developed by the department. Educators are also encouraged to complete the plink course: What you need to know: Cyber security Department developed scope and sequence documents and units in the following subject areas cover cyber safety:&amp;nbsp;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Heath and Physical Education&amp;nbsp;&lt;/li&gt;&lt;li&gt;Digital Technology&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&quot;,
                                    &quot;heading&quot;: &quot;Department Provided templates and teaching resources&quot;
                                }
                            ]
                        }
                    }
                },
                &quot;type&quot;: &quot;templates&quot;
            },
