                                {
                                    &quot;icon&quot;: &quot;fas-eye&quot;,
                                    &quot;content&quot;: &quot;&lt;h2&gt;&lt;strong&gt;Microsoft:&lt;/strong&gt;&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;Microsoft Color Filters&lt;/strong&gt; &ndash; Use color filters to change screen display colors to enhance clarity for those with visual problems, including color blindness. To use them with Microsoft 10, go to Start &amp;gt; Settings &amp;gt; Ease of Access &amp;gt; Color Filters. Turn on filters and try the different options to find the one that works best for you.&lt;/li&gt;&lt;li&gt;&lt;a href=\&quot;https://support.microsoft.com/en-us/help/11542/windows-use-magnifier-to-make-things-easier-to-see\&quot;&gt;&lt;strong&gt;Magnifier&lt;/strong&gt;&lt;/a&gt; &ndash; This handy tool magnifies a portion of your screen for enhanced viewing of words and images.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Immersive Reader&lt;/strong&gt; &ndash; This language tool is available on many Microsoft platforms and offers several resources to assist with reading comprehension, including dictation of text, focus mode for viewing a single line of text on a page, adjusting font size and spacing, highlighting different parts of speech, and translating into other languages. Look for a little book icon with a speaker on it to use Immersive Reader with Word Online, Outlook Online, Edge, Microsoft Teams, and a wide variety of Microsoft tools. Try using it&lt;a href=\&quot;https://www.onenote.com/learningtools\&quot;&gt;&lt;strong&gt; &lt;/strong&gt;here&lt;/a&gt;.&lt;/li&gt;&lt;li&gt;&lt;a href=\&quot;https://www.howtogeek.com/353555/how-to-use-reading-view-in-microsoft-edge/\&quot;&gt;&lt;strong&gt;Reading View&lt;/strong&gt;&lt;/a&gt; &ndash; Select Reading View in the Edge toolbar to remove clutter such as ads from pages to leave just the text, thereby simplifying the content of any website for reading without distractions.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;&lt;strong&gt;Google:&lt;/strong&gt;&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=\&quot;https://www.google.com/chrome/?brand=CHBD&amp;amp;gclid=Cj0KCQjww_f2BRC-ARIsAP3zarH6MvyNeBzM6hL8DP0cl-gPv1yDVJKUwHqCcrRi8hX6GksmlAxDW9QaAlX-EALw_wcB&amp;amp;gclsrc=aw.ds\&quot;&gt;&lt;strong&gt;Chrome Browser&lt;/strong&gt;&lt;/a&gt; &ndash; Change text and image sizes. In the upper right-hand corner of your Chrome browser, select the three dots (or the small arrow) and choose from the Zoom options to enlarge items on your screen. Look for additional options under Settings &amp;gt; Appearance to customize font size and select from different options for fonts.&lt;/li&gt;&lt;li&gt;&lt;a href=\&quot;https://chrome.google.com/webstore/detail/bite-sized/fgckabonplgfoiimecdddjdljmlflajo\&quot;&gt;&lt;strong&gt;Bite-Sized&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; (Chrome Extension)&lt;/strong&gt; &ndash; This extension displays the content of web pages in smaller chunks, useful for struggling readers or those with anxiety issues.&lt;/li&gt;&lt;li&gt;&lt;a href=\&quot;https://chrome.google.com/webstore/detail/websites-accessibility/aefndakodjcaapnmofhkmdbkabghakgn\&quot;&gt;&lt;strong&gt;Websites Accessibility&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; (Chrome Extension)&lt;/strong&gt; &ndash; Use this extension to add an accessibility menu to every site. This tool changes text size, underlines links, provides text to speech and speech to text, and includes options to change the color of websites for more comfortable viewing.&lt;/li&gt;&lt;li&gt;&lt;a href=\&quot;https://chrome.google.com/webstore/detail/read-aloud-a-text-to-spee/hdhinadidafjejdhmfkjgnolgimiaplp\&quot;&gt;&lt;strong&gt;ReadAloud&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; (Chrome Extension)&lt;/strong&gt; &ndash; Use this extension to convert text to voice and listen to web page articles in one click. Additional options offer the ability to translate information into over 40 languages.&lt;/li&gt;&lt;li&gt;&lt;a href=\&quot;https://chrome.google.com/webstore/detail/color-enhancer/ipkjmjaledkapilfdigkgfmpekpfnkih\&quot;&gt;&lt;strong&gt;Color Enhancer&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; (Chrome Extension)&lt;/strong&gt; &ndash; Use the Color Enhancer to apply color filters to web pages to improve color perception, especially for those with color blindness.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&quot;,
                                    &quot;heading&quot;: &quot;Tools to assist with reading, vision, and hearing&quot;
                                },
                                {
                                    &quot;icon&quot;: &quot;fas-hand-paper&quot;,
                                    &quot;content&quot;: &quot;&lt;h2&gt;&amp;nbsp;&lt;strong&gt;Microsoft:&lt;/strong&gt;&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;Simplify (desktop setting)&lt;/strong&gt; &ndash; Minimize visual distractions by turning off animations, background images, and more. Select Start &amp;gt; Settings &amp;gt; Ease of Access &amp;gt; Display. Then choose from the different options under Simplify and Personalize Windows.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;&lt;strong&gt;Google:&lt;/strong&gt;&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=\&quot;https://chrome.google.com/webstore/detail/reader-view/ffjfpdidfimbjpjdhceafjdimhehphcf\&quot;&gt;&lt;strong&gt;ReaderView&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; (Chrome Extension) &lt;/strong&gt;&ndash; Remove clutter from web pages and view in Reader Mode. Easily switch back and forth between the two different views.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&quot;,
                                    &quot;heading&quot;: &quot;Turn off distractions&quot;
                                },
                                {
                                    &quot;icon&quot;: &quot;fas-file-alt&quot;,
                                    &quot;content&quot;: &quot;&lt;h2&gt;&amp;nbsp;&lt;strong&gt;Microsoft:&lt;/strong&gt;&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=\&quot;https://support.microsoft.com/en-us/office/do-things-quickly-with-tell-me-f20d2198-17b8-4b09-a3e5-007a337f1e4e?ui=en-us&amp;amp;rs=en-us&amp;amp;ad=us\&quot;&gt;&lt;strong&gt;Tell Me&lt;/strong&gt;&lt;/a&gt; &ndash; Use the text field to search words and phrases describing what you want to do in the document and access features you need. Click the light bulb icon to the right of tabs to get started.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Dictate &lt;/strong&gt;&ndash; Use speech to text features to dictate in Microsoft Office documents. Sign in to your Microsoft account and follow the prompts from Home &amp;gt; Dictate.&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;&lt;strong&gt;Google:&lt;/strong&gt;&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;&lt;strong&gt;Voice Typing&lt;/strong&gt; &ndash; Enable the microphone on your computer, select Tools &amp;gt; Voice Typing while within a Google Document, then click the microphone icon. Speak clearly to begin voice typing. As you use the voice option, follow tips to learn how to add punctuation. This tool is straightforward to use and accurate! I dictated several portions of this blog to try it out and didn&rsquo;t run into any translation issues.&lt;/li&gt;&lt;li&gt;&lt;strong&gt;Translate &lt;/strong&gt;&ndash; This is another accessibility feature found under the Tools option within Google Documents. This feature creates a copy of your document translated into one of many languages offered.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&amp;nbsp;&lt;/p&gt;&quot;,
                                    &quot;heading&quot;: &quot;Tools for working within documents&quot;
                                }
                            ]
                        }
                    }
