                        {
                            &quot;content&quot;: &quot;&lt;p&gt;&amp;nbsp;Of course, there are many more options to address all forms of disabilities. To learn more, visit each company&rsquo;s site for additional options.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=\&quot;https://www.microsoft.com/en-us/accessibility\&quot;&gt;&lt;strong&gt;Microsoft&lt;/strong&gt;&lt;/a&gt; &ndash; Browse this page to learn about and access the many different accessibility tools offered by Microsoft.&lt;/li&gt;&lt;li&gt;&lt;a href=\&quot;https://www.google.com/accessibility/products-features/\&quot;&gt;&lt;strong&gt;Google&lt;/strong&gt;&lt;/a&gt; &ndash; Choose from the different options provided by Google for accessibility within their various products.&lt;/li&gt;&lt;li&gt;&lt;a href=\&quot;https://chrome.google.com/webstore/category/extensions\&quot;&gt;&lt;strong&gt;Chrome Store Extensions&lt;/strong&gt;&lt;/a&gt; &ndash; Search within the Chrome store by choosing the accessibilities category to find Chrome add-ons for multiple uses.&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;Providing assistive technology is an easy way to encourage learning and build confidence in your students, even those without disabilities. Do you have a favorite accessibility tool to share with our readers? We would love to hear how you use these tools in your classroom in the comments below.&amp;nbsp;&lt;/p&gt;&quot;,
                            &quot;heading&quot;: &quot;Where can I find more accessibility tools?&quot;
                        }
                    ]
                },
                &quot;type&quot;: &quot;extra_resources&quot;
            }
