    {
        &quot;post_id&quot;: 18,
        &quot;post_title&quot;: &quot;Google Workspace Tips&quot;,
        &quot;post_content&quot;: &quot;&lt;h2&gt;Google Workspace Productivity Tips and Tricks&lt;/h2&gt;&lt;p&gt;Organisations of any size always strive to reach their maximum productivity. It secures growth and confidence that every resource is maximised for the benefit of the whole team and organisation. This is why &lt;a href=\&quot;https://onsitehelper.com/google-workspace/\&quot;&gt;Google Workspace&lt;/a&gt; (formerly known as G Suite) is the &lt;strong&gt;favoured &lt;/strong&gt;&lt;a href=\&quot;https://onsitehelper.com/google-workspace-vs-microsoft-365-2022-which-is-the-better-cloud-office-system/\&quot;&gt;&lt;strong&gt;cloud office system&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt; by businesses from startups to enterprises&lt;/strong&gt;.&lt;/p&gt;&lt;p&gt;With over a dozen of useful applications and &lt;a href=\&quot;https://onsitehelper.com/10-reasons-why-you-should-upgrade-to-google-workspace-2022/\&quot;&gt;countless features&lt;/a&gt;, it&rsquo;s understandable that some might not even be aware of the productivity features that Google Workspace has to offer. On top of that, Google regularly &lt;a href=\&quot;https://onsitehelper.com/google-workspace-updates-whats-in-store-for-you-this-2022/\&quot;&gt;updates Google Workspace&lt;/a&gt; to further improve its services and increase the productivity of users.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;a href=\&quot;https://onsitehelper.com/\&quot;&gt;Onsite Helper&lt;/a&gt; has put together a list of useful features that help businesses and new users with their Google Workspace experience. Here are &lt;strong&gt;13 Google Workspace tips and tricks&lt;/strong&gt; that will surely maximise your productivity!&amp;nbsp;&lt;/p&gt;&lt;p&gt;&amp;nbsp;&lt;figure data-trix-attachment=\&quot;{&amp;quot;contentType&amp;quot;:&amp;quot;image&amp;quot;,&amp;quot;height&amp;quot;:378,&amp;quot;url&amp;quot;:&amp;quot;https://onsitehelper.com/wp-content/uploads/2022/02/13-Google-Workspace-productivity-tips-and-tricks.png&amp;quot;,&amp;quot;width&amp;quot;:640}\&quot; data-trix-content-type=\&quot;image\&quot; class=\&quot;attachment attachment--preview\&quot;&gt;&lt;img src=\&quot;https://onsitehelper.com/wp-content/uploads/2022/02/13-Google-Workspace-productivity-tips-and-tricks.png\&quot; width=\&quot;640\&quot; height=\&quot;378\&quot;&gt;&lt;figcaption class=\&quot;attachment__caption\&quot;&gt;&lt;/figcaption&gt;&lt;/figure&gt;&lt;/p&gt;&quot;,
        &quot;post_excerpt&quot;: &quot;Google Workspace is a collection of cloud computing, productivity and collaboration tools, software and products developed and marketed by Google.&quot;,
        &quot;author&quot;: &quot;Google&quot;,
        &quot;cover_image&quot;: &quot;uploads/advice/edSpark-advice-google-workspace.png&quot;,
        &quot;template&quot;: null,
        &quot;extra_content&quot;: [
            {
                &quot;data&quot;: {
                    &quot;template&quot;: &quot;App\\Filament\\PageTemplates\\Advice\\Numbereditems&quot;,
                    &quot;extra_content&quot;: {
                        &quot;numbereditems&quot;: {
                            &quot;item&quot;: [
                                {
                                    &quot;icon&quot;: null,
                                    &quot;content&quot;: &quot;&lt;p&gt;This Google Workspace productivity tip will allow you to send large files.&lt;/p&gt;&lt;p&gt;By default, &lt;a href=\&quot;https://www.google.com/gmail/\&quot;&gt;Gmail&lt;/a&gt; only allows users to attach files up to 25 Mb to their emails. One workaround that you can use to &lt;strong&gt;send larger files via Gmail is by attaching files using &lt;/strong&gt;&lt;a href=\&quot;https://www.google.com/intl/en_au/drive/\&quot;&gt;&lt;strong&gt;Google Drive&lt;/strong&gt;&lt;/a&gt;. This feature greatly saves time and data bandwidth. To attach large files, make sure that the file that you want to send is uploaded to your Google Drive. Click the Drive icon in the compose toolbar and simply select the file you want to send.&lt;/p&gt;&lt;p&gt;Remember that the files in your Drive will still abide by &lt;a href=\&quot;https://onsitehelper.com/how-to-set-up-data-loss-prevention-in-google-workspace/\&quot;&gt;Google DLP&lt;/a&gt; and &lt;a href=\&quot;https://onsitehelper.com/increase-your-companys-data-protection-using-drive-labels-with-google-workspace/\&quot;&gt;Drive label&lt;/a&gt; restrictions if you have those setup, so &lt;strong&gt;make sure that you&rsquo;re allowed to share the file that you want to share&lt;/strong&gt;.&amp;nbsp;&lt;/p&gt;&quot;,
                                    &quot;heading&quot;: &quot;Attach large files to your email using Google Drive&quot;
                                },
                                {
                                    &quot;icon&quot;: null,
                                    &quot;content&quot;: &quot;&lt;p&gt;In the &lt;a href=\&quot;https://play.google.com/store/apps/details?id=com.google.android.apps.docs&amp;amp;hl=en_AU&amp;amp;gl=US\&quot;&gt;Google Drive app&lt;/a&gt;, you can create new files by scanning images. Simply click the &ldquo;+&rdquo; icon in your Google Drive app and select &ldquo;Scan&rdquo;. This will allow you to take a photo of a document which Google Drive will then save as a PDF. Finally, you can &lt;strong&gt;copy the text from the photo that you save for later use&lt;/strong&gt;. This Google Workspace productivity tip utilises Google&rsquo;s compatibility over different devices. If you want to level up your Workspace usage, make sure you&rsquo;re enjoying the different apps over different devices.&amp;nbsp;&lt;/p&gt;&quot;,
                                    &quot;heading&quot;: &quot;Convert images to text using Google Drive&rsquo;s file scanner&quot;
                                },
                                {
                                    &quot;icon&quot;: null,
                                    &quot;content&quot;: &quot;&lt;p&gt;If taking photos isn&rsquo;t enough for you, you can also &lt;strong&gt;use Voice Typing to write documents on Google Docs&lt;/strong&gt;. &lt;a href=\&quot;https://assistant.google.com/\&quot;&gt;Google&rsquo;s Voice assistant&lt;/a&gt; is already one of the most advanced and precise when it comes to AI technology. You can now use this to write documents by simply using your voice. Take full advantage of this Google Workspace productivity tip especially when you&rsquo;re already tired of typing. Enable this feature on &lt;a href=\&quot;https://docs.google.com/\&quot;&gt;Google Docs&lt;/a&gt; by clicking &lt;em&gt;Tools &amp;gt; Voice Typing.&lt;/em&gt;&lt;/p&gt;&lt;p&gt;Alternatively, you can also use the shortcut &lt;em&gt;Ctrl + Shift + S&lt;/em&gt;.&amp;nbsp;&lt;/p&gt;&quot;,
                                    &quot;heading&quot;: &quot;Use Voice Typing when creating a document&quot;
                                },
                                {
                                    &quot;icon&quot;: null,
                                    &quot;content&quot;: &quot;&lt;p&gt;Google Workspace was built with collaboration in mind. In that regard, with this Google Workspace productivity tip, you can&lt;strong&gt; co-edit documents, spreadsheets, and presentations with your team simultaneously.&lt;/strong&gt; You can see changes done by your team live, users can leave comments, and there&rsquo;s a record of the changes done by each team member to a document.&lt;/p&gt;&lt;p&gt;Simply share your documents with other users and they can start editing the document with you if you give them the &lsquo;Editor&rsquo; role.&amp;nbsp;&lt;/p&gt;&quot;,
                                    &quot;heading&quot;: &quot;Create Docs with your team&quot;
                                },
                                {
                                    &quot;icon&quot;: null,
                                    &quot;content&quot;: &quot;&lt;p&gt;If your you receive lots of emails, this Google Workspace productivity tip is for you. If you&rsquo;re overwhelmed and can&rsquo;t reply to each and every email on time, then you should set up the &lt;strong&gt;&ldquo;Automated response&rdquo;&lt;/strong&gt; feature on Gmail. Similarly, you can also use this feature when you are Out-of-Office. To do this, simply go to your Gmail settings, under General, you should be able to set up your &lt;a href=\&quot;https://support.google.com/mail/answer/25922?hl=en&amp;amp;co=GENIE.Platform%3DDesktop\&quot;&gt;Out-of-Office response&lt;/a&gt; there.&amp;nbsp;&lt;/p&gt;&quot;,
                                    &quot;heading&quot;: &quot;Use auto-response on Gmail&quot;
                                },
                                {
                                    &quot;icon&quot;: null,
                                    &quot;content&quot;: &quot;&lt;p&gt;With Gmail, you normally have 5 seconds to undo or unsend the email you just sent out. If you ask us, 5 seconds simply isn&rsquo;t enough. To be safe, &lt;strong&gt;increase it to 30 seconds&lt;/strong&gt; by going to your Gmail settings, and changing the option to &lsquo;30 seconds&rsquo; on the &lt;em&gt;Undo Send&lt;/em&gt; setting. Now, you&rsquo;ll have more than enough time to cancel the email you just sent in case you forgot to send an attachment or forgot to mention something (or regret what you just sent &ndash; Gmail has got your back).&amp;nbsp;&lt;/p&gt;&quot;,
                                    &quot;heading&quot;: &quot;Increase email cancellation period&quot;
                                }
                            ]
                        }
                    }
                },
                &quot;type&quot;: &quot;templates&quot;
            },
            {
                &quot;data&quot;: {
                    &quot;item&quot;: [
                        {
                            &quot;content&quot;: &quot;&lt;p&gt;&lt;a href=\&quot;https://onsitehelper.com/\&quot;&gt;&lt;strong&gt;Onsite Helper&lt;/strong&gt;&lt;/a&gt;&lt;strong&gt;, Australia&rsquo;s leading Google Workspace partner, specialises in Google Workspace migration, training, support, management, security, and everything Google Workspace.&lt;/strong&gt; Our &lt;a href=\&quot;https://onsitehelper.com/case-studies/\&quot;&gt;clients&lt;/a&gt; have enjoyed our managed IT services for years and your &lt;a href=\&quot;https://onsitehelper.com/google-workspace-for-growing-businesses-2/\&quot;&gt;business&lt;/a&gt; could be a part of that too.&lt;/p&gt;&lt;p&gt;And now, in the post-pandemic era, Onsite Helper guarantees that moving to Google Workspace is the best decision you can make for your business. Integrating Google Workspace into your system will provide your business &lt;strong&gt;smoother communication through Chats&lt;/strong&gt;, &lt;strong&gt;faster collaboration and real-time document editing&lt;/strong&gt;, and a powerful&lt;strong&gt; email system&lt;/strong&gt;.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Get a great deal with Google Workspace today!&amp;nbsp;&lt;/p&gt;&quot;,
                            &quot;heading&quot;: &quot;Upgrading to Google Workspace? Want more Google Workspace Productivity Tips?&quot;
                        }
                    ]
                },
                &quot;type&quot;: &quot;extra_resources&quot;
            }
        ],
