        &quot;post_title&quot;: &quot;Adobe Education Exchange Adobe program&quot;,
        &quot;post_content&quot;: &quot;&lt;h2&gt;Adobe Creative Educator&lt;/h2&gt;&lt;h3&gt;Together, we work to support the next generation to become life-long creators.&lt;/h3&gt;&lt;p&gt;We invite you to join the new Adobe Creative Educator program for educators in every subject area and grade level. In this community program you will receive curated professional development materials, information about virtual and in-person events, and the opportunity to connect with like-minded educators from around the world. To recognize your professional development you&rsquo;ll earn badges for completing each level of the Adobe Creative Educator program.&amp;nbsp;&lt;/p&gt;&quot;,
