    {
        &quot;post_id&quot;: 20,
        &quot;post_title&quot;: &quot;Education Help and Learning Support Page&quot;,
        &quot;post_content&quot;: &quot;&lt;h2&gt;Preparing for the school year with Microsoft Education tools&lt;/h2&gt;&lt;p&gt;&amp;nbsp;&lt;em&gt;Microsoft Teams for Education&lt;/em&gt;&amp;nbsp;&lt;/p&gt;&lt;p&gt;This guide is here to help educators and school leaders prepare, develop, and implement educational solutions using Microsoft Education tools. Get started with quick links to resources and content that works for your school or district, including solutions for blended, hybrid, or remote learning instructional models.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;h2&gt;Checklist for choosing and setting up your tools:&lt;/h2&gt;&lt;h3&gt;&lt;strong&gt;Environment&lt;/strong&gt;: Redesign learning spaces to engage student thinking beyond the walls of a classroom.&lt;br&gt;&lt;figure data-trix-attachment=\&quot;{&amp;quot;contentType&amp;quot;:&amp;quot;image&amp;quot;,&amp;quot;height&amp;quot;:347,&amp;quot;url&amp;quot;:&amp;quot;https://support.content.office.net/en-us/media/4942afbc-9d51-4d17-a247-05795a6914fa.png&amp;quot;,&amp;quot;width&amp;quot;:520}\&quot; data-trix-content-type=\&quot;image\&quot; class=\&quot;attachment attachment--preview\&quot;&gt;&lt;img src=\&quot;https://support.content.office.net/en-us/media/4942afbc-9d51-4d17-a247-05795a6914fa.png\&quot; width=\&quot;520\&quot; height=\&quot;347\&quot;&gt;&lt;figcaption class=\&quot;attachment__caption\&quot;&gt;&lt;/figcaption&gt;&lt;/figure&gt;&lt;/h3&gt;&lt;p&gt;Build flexible, creative digital spaces for learning that engage students in critical thinking and project-based learning.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=\&quot;https://support.microsoft.com/en-us/topic/get-the-system-ready-cbf1bb33-999e-47cd-a820-974c39c8098c\&quot;&gt;&lt;span style=\&quot;text-decoration: underline;\&quot;&gt;&amp;nbsp;Get the system ready&lt;/span&gt;&lt;/a&gt;&lt;/li&gt;&lt;/ul&gt;&lt;h3&gt;&lt;strong&gt;Instructional toolbox&lt;/strong&gt;: Support student instruction, engagement, and interventions.&lt;figure data-trix-attachment=\&quot;{&amp;quot;contentType&amp;quot;:&amp;quot;image&amp;quot;,&amp;quot;height&amp;quot;:347,&amp;quot;url&amp;quot;:&amp;quot;https://support.content.office.net/en-us/media/3a04c933-0d7c-49d2-9ac3-f3374e913e60.png&amp;quot;,&amp;quot;width&amp;quot;:520}\&quot; data-trix-content-type=\&quot;image\&quot; class=\&quot;attachment attachment--preview\&quot;&gt;&lt;img src=\&quot;https://support.content.office.net/en-us/media/3a04c933-0d7c-49d2-9ac3-f3374e913e60.png\&quot; width=\&quot;520\&quot; height=\&quot;347\&quot;&gt;&lt;figcaption class=\&quot;attachment__caption\&quot;&gt;&lt;/figcaption&gt;&lt;/figure&gt;&lt;/h3&gt;&lt;p&gt;Learn more about strategies within Microsoft Teams to engage, assess, and evaluate student learning.&lt;/p&gt;&lt;ul&gt;&lt;li&gt;&lt;a href=\&quot;https://support.microsoft.com/en-us/topic/get-organized-eae2bea7-a429-4d30-9abc-821c49bfedb6\&quot;&gt;&lt;span style=\&quot;text-decoration: underline;\&quot;&gt;Get organized with M365 for Education tools&lt;/span&gt;&lt;/a&gt;&lt;/li&gt;&lt;/ul&gt;&lt;h3&gt;&lt;strong&gt;Community&lt;/strong&gt;: Build a culture of outreach and support!&lt;figure data-trix-attachment=\&quot;{&amp;quot;contentType&amp;quot;:&amp;quot;image&amp;quot;,&amp;quot;height&amp;quot;:391,&amp;quot;url&amp;quot;:&amp;quot;https://support.content.office.net/en-us/media/19b81d3f-9c6a-434d-98f4-5594141e60e6.png&amp;quot;,&amp;quot;width&amp;quot;:520}\&quot; data-trix-content-type=\&quot;image\&quot; class=\&quot;attachment attachment--preview\&quot;&gt;&lt;img src=\&quot;https://support.content.office.net/en-us/media/19b81d3f-9c6a-434d-98f4-5594141e60e6.png\&quot; width=\&quot;520\&quot; height=\&quot;391\&quot;&gt;&lt;figcaption class=\&quot;attachment__caption\&quot;&gt;&lt;/figcaption&gt;&lt;/figure&gt;&lt;/h3&gt;&lt;p&gt;&lt;br&gt;Discover ideas for creating engaging opportunities to connect with students wherever you&#039;re teaching and learning.&lt;/p&gt;&lt;ul&gt;&l