        &quot;post_content&quot;: &quot;&lt;h2&gt;Details&lt;/h2&gt;&lt;p&gt;Teams allows teachers to easily manage class workflow while engaging every student, no matter which communication style they prefer.&amp;nbsp;&lt;br&gt;&lt;br&gt;Teams allows teachers and students to keep everything in one place with Class Notebook, Assignments, Office apps, and files built into every class. It also encourages rich conversations, video, and fun content for student involvement.&amp;nbsp;&lt;br&gt;&lt;br&gt;Staff can manage conversations and files and search across people, files and chats. Teams provides instant access to SharePoint, OneNote and Planner. Staff can also create and edit documents in Teams for greater collaboration.&amp;nbsp;&lt;br&gt;&lt;br&gt;Teams can be used to create class-based teams, PLC (Professional Learning Community) teams, Staff Member teams and general interest teams depending on the required resources.&lt;/p&gt;&lt;h2&gt;USE CASES&lt;/h2&gt;&lt;h3&gt;Use case - staff&lt;/h3&gt;&lt;p&gt;This service is usable across all aspects of the school day from Staff collaboration and professional development through to curriculum development and lesson delivery. A purpose-built collaborative platform, Teams brings together many M365 services into a single interface allowing teachers and students Conversation Sharing files Assignment management Integration with other M365 services. For example, OneNote, Stream and Planner&amp;nbsp;&lt;br&gt;&lt;br&gt;Note: the services to be integrated must be enabled within IDM Admin for the appropriate staff &amp;amp; student groups. Centralised class management&amp;nbsp;&lt;/p&gt;&lt;h3&gt;Use case - student&amp;nbsp;&lt;/h3&gt;&lt;p&gt;Students should be consuming all of the above directly from the Teams interface through web, or mobile device. Teams is a central place for students to go to when looking for class notes, resources, or further information on assignments. It can be used to distribute and collect assignments. 