than 40 cultures and nationalities.\&quot;}},{\&quot;id\&quot;:\&quot;z0uDwFCwSj\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our college is structured around three sub-schools: Primary, catering for students from Reception to Year 6, Middle for students from Year 7 to Year 9, and Senior for students from Year 10 to Year 12.\&quot;}},{\&quot;id\&quot;:\&quot;ssW0_0uM9q\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our R-12 college community is strengthened by being located on one site, allowing collaboration, access to specialist teachers and facilities, and educational and extra-curricular programs.\&quot;}},{\&quot;id\&quot;:\&quot;IIm7H5Vsdh\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our purpose is to allow every student to reach their full potential in a safe, achievement-oriented environment, where they are supported every step of their Plympton journey by our team of nurturing and innovative staff who are passionate advocates for bilingual international education.\&quot;}},{\&quot;id\&quot;:\&quot;YXADLtmeMj\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Plympton International College provides challenging, engaging and supportive learning programs that encourage students to understand themselves, develop their interests and recognise their strengths, guiding their future pathways.\&quot;}},{\&quot;id\&quot;:\&quot;mfHPlPwAdh\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;We are proud of our partnerships with The University of Adelaide, Flinders University and the University of South Australia, providing our students with leading-edge opportunities and pathways to begin early entrance and bespoke pathways to university studies.\&quot;}},{\&quot;id\&quot;:\&quot;ueTHZk6iTu\&quot;,\&quot;type\&quot;:\&quot;paragraph