        &quot;content_blocks&quot;: &quot;{\&quot;time\&quot;:1687399584077,\&quot;blocks\&quot;:[{\&quot;id\&quot;:\&quot;5JmaAJRpXl\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;font size=\\\&quot;5\\\&quot;&gt;&lt;b&gt;Glenunga High School&lt;/b&gt;&lt;/font&gt;\&quot;,\&quot;level\&quot;:2}},{\&quot;id\&quot;:\&quot;5S0Ka564D3\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;Our Purpose&lt;/b&gt;\&quot;,\&quot;level\&quot;:2}},{\&quot;id\&quot;:\&quot;ly-SfTR7Ks\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Glenunga International High School inspires every student to develop their potential as an internationally minded, creative thinking, responsible citizen.\&quot;}},{\&quot;id\&quot;:\&quot;Ld_qe2pjFX\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;Our Values&lt;/b&gt;\&quot;,\&quot;level\&quot;:2}},{\&quot;id\&quot;:\&quot;rHiKGtZ7Fq\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Excellence&amp;nbsp;PB\&quot;,\&quot;level\&quot;:5}},{\&quot;id\&quot;:\&quot;2Rfax9ThZy\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Exceptional teaching and learning striving for personal best; demonstrating persistence and integrity; celebrating achievements.\&quot;}},{\&quot;id\&quot;:\&quot;gn9oCt6gcG\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;OpportunityU\&quot;,\&quot;level\&quot;:5}},{\&quot;id\&quot;:\&quot;JIzRvYwFv3\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Personalised learning choices in subjects, pathways and Student Life activities; valuing creativity and flexibility; the opportunity to be you\&quot;}},{\&quot;id\&quot;:\&quot;6OFh_d_Npa\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;International Mindedness\&quot;,\&quot;level\&quot;:5}},{\&quot;id\&quot;:\&quot;ZG54PkY4B8\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;A global perspective learning in an international context; appreciating and celebrating cultural diversity; becoming active world citizens.\&quot;}},{\&quot;id\&quot;:\&quot;9JeVorMdtv\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Harmony\&quot;,\&quot;level\&quot;:5}},{\&quot;id\&quot;:\&quot;huSUOMkoJy\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;A cooperative and vibrant community: respectful relationships; caring for the environment; people working together.\&quot;}},{\&quot;id\&quot;:\&quot;2isXLObV6g\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;font size=\\\&quot;5\\\&quot;&gt;&lt;b&gt;A MESSAGE FROM THE PRINCIPAL&lt;/b&gt;&lt;/font&gt;\&quot;,\&quot;level\&quot;:2}},{\&quot;id\&quot;:\&quot;Evi39BGtbP\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;As Principal of Glenunga International High School, I am privileged to lead a school community that is passionate about inspiring every student to achieve their personal best in a harmonious, internationally minded, learning culture. It is a pleasure to see the transformational journey our students make, arriving from primary school and leaving as internationally minded, creative thinking, responsible citizens.\&quot;}},{\&quot;id\&quot;:\&quot;VYd9v6DGnL\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;We are committed to continuous improvement to ensure we deliver the best possible learning outcomes for students in an ever-changing world. Our international accreditation by the&amp;nbsp;&lt;a href=\\\&quot;https://www.cois.org/\\\&quot;&gt;Council of International Schools&lt;/a&gt;&amp;nbsp;(CIS) affirms this commitment.\&quot;}},{\&quot;id\&quot;:\&quot;AThxVAs8dA\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;a href=\\\&quot;https://gihs.sa.edu.au/our-school/our-purpose-and-values/\\\&quot;&gt;Our Values&lt;/a&gt;&amp;nbsp;&ndash;&amp;nbsp;ExcellencePB,&amp;nbsp;OpportunityU,&amp;nbsp;International Mindedness&amp;nbsp;and&amp;nbsp;Harmony&amp;nbsp;&ndash; permeate our culture, guide our behaviours and are practised by every member of our school community.\&quot;}},{\&quot;id\&quot;:\&quot;rM-3T-M1LZ\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Glenunga is known nationally for its very high academic standards and specialty programs in&amp;nbsp;&lt;a href=\\\&quot;https://gihs.sa.edu.au/specialist-programs/ignite/\\\&quot;&gt;IGNITE&lt;/a&gt;&amp;nbsp;&ndash; for students with high intellectual potential, and the&amp;nbsp;&lt;a href=\\\&quot;https://gihs.sa.edu.au/curriculum/international-baccalaureate/\\\&quot;&gt;International Baccalaureate Diploma&lt;/a&gt;.\&quot;}},{\&quot;id\&quot;:\&quot;D1Fhxq0Er4\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our team of passionate teachers, support staff and leaders are committed to delivering exceptional learning and a rich diversity of holistic programs. Together, we support each student to be the best versions of themselves, nurturing their wellbeing and equipping them to thrive on challenge in the context of an unpredictable world beyond school.\&quot;}},{\&quot;id\&quot;:\&quot;N-KkMoPZJc\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our teachers work collaboratively to personalise student learning for all students, to develop deep academic understandings and to build specific 21st&amp;nbsp;century skills &ndash; creative and critical thinking; collaboration; communication; citizenship and character &ndash; which form the basis for innovation and entrepreneurial thinking.\&quot;}},{\&quot;id\&quot;:\&quot;9bo_8GDzRm\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Glenunga is the largest, public, single-site, secondary school in South Australia. Despite our size, we pride ourselves on knowing each student as an individual. Our students come from more than 90 different culture, creating a diverse, vibrant and harmonious community, which we celebrate every day and in special events like CommUnity Week, Reconciliation Week and Harmony Day.\&quot;}},{\&quot;id\&quot;:\&quot;4dDOeQLR4h\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;We are very fortunate in terms of the support we enjoy from families, who value the educational and holistic development opportunities we provide for their students. In return, they contribute their skills and financial support as well as enthusiastic participation in events, including parent information evenings, learner conferences, hosting international students and attending various performances and celebrations.\&quot;}},{\&quot;id\&quot;:\&quot;0-Uo0cyoiW\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our community is represented by a highly skilled Governing Council, which meets monthly to monitor our school&rsquo;s progress against our strategic priorities and budget. They also oversee our accreditation responsibilities to the CIS and International Baccalaureate.\&quot;}},{\&quot;id\&quot;:\&quot;IkO1GM54-T\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;I invite you to explore our&amp;nbsp;&lt;a href=\\\&quot;https://gihs.sa.edu.au/wp-content/uploads/2023/04/2023-School-Info-Brochure.pdf\\\&quot;&gt;school information brochure&lt;/a&gt;&amp;nbsp;and website to discover what makes 