arning and social opportunities for students, and all staff know the students and understand their needs.&amp;nbsp;Our&amp;nbsp;students are everyone&rsquo;s responsibility.\&quot;}},{\&quot;id\&quot;:\&quot;d7futJz9Tc\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our onsite preschool provides an excellent Early Years environment and a comprehensive transition to school. As the children are on site, there are many opportunities to engage in activities with the rest of the school, including regular interactions with the Reception class, assemblies and performances.\&quot;}},{\&quot;id\&quot;:\&quot;G_Gl9jQBGz\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;font size=\\\&quot;5\\\&quot;&gt;WHAT WE DO&lt;/font&gt;\&quot;}},{\&quot;id\&quot;:\&quot;jy4KIiNU8_\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;We are very lucky to have a supportive community of parents and families, many of whom volunteer their valuable time for the benefit of the school and our students.\&quot;}},{\&quot;id\&quot;:\&quot;qNndvV6Xoq\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Echunga Primary School also provides additional services such as a Before and After School Care and Vacation Care OSHC service.&amp;nbsp;\&quot;}},{\&quot;id\&quot;:\&quot;TpBKPhxMRn\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;We are very proud of what we have and what we are developing here at Echunga Primary School and know that, by working together, we can help our young people to be successful and powerful learners with the dispositions to embrace whatever life holds for them in the future.\&quot;}},{\&quot;id\&quot;:\&quot;qYbGaUtq7e\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;You are welcome to come and have a to