than 40 cultures and nationalities.\&quot;}},{\&quot;id\&quot;:\&quot;z0uDwFCwSj\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our college is structured around three sub-schools: Primary, catering for students from Reception to Year 6, Middle for students from Year 7 to Year 9, and Senior for students from Year 10 to Year 12.\&quot;}},{\&quot;id\&quot;:\&quot;ssW0_0uM9q\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our R-12 college community is strengthened by being located on one site, allowing collaboration, access to specialist teachers and facilities, and educational and extra-curricular programs.\&quot;}},{\&quot;id\&quot;:\&quot;IIm7H5Vsdh\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our purpose is to allow every student to reach their full potential in a safe, achievement-oriented environment, where they are supported every step of their Plympton journey by our team of nurturing and innovative staff who are passionate advocates for bilingual international education.\&quot;}},{\&quot;id\&quot;:\&quot;YXADLtmeMj\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Plympton International College provides challenging, engaging and supportive learning programs that encourage students to understand themselves, develop their interests and recognise their strengths, guiding their future pathways.\&quot;}},{\&quot;id\&quot;:\&quot;mfHPlPwAdh\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;We are proud of our partnerships with The University of Adelaide, Flinders University and the University of South Australia, providing our students with leading-edge opportunities and pathways to begin early entrance and bespoke pathways to university studies.\&quot;}},{\&quot;id\&quot;:\&quot;ueTHZk6iTu\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;As the only Chinese bilingual college in South Australia, our students have the opportunity to become fluent in both English and Chinese language. We offer a specialist language program in Chinese Mandarin, which develops students&rsquo; language proficiency and intercultural understanding, preparing them to engage meaningfully and purposefully in a globalised world.\&quot;}},{\&quot;id\&quot;:\&quot;l1YIC6-LG_\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;It&rsquo;s a transformative time at Plympton International College, with ongoing masterworks that will provide our students with state-of-the-art learning facilities.\&quot;}},{\&quot;id\&quot;:\&quot;Ul5Ulf3NjY\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;At Plympton International College, the well-being of our students is central to learning and learning contributes to well-being. A number of programs and support services exist to ensure that your child is nurtured in a caring, encouraging environment.\&quot;}},{\&quot;id\&quot;:\&quot;divZkOr9Bp\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;We believe that student well-being complements academic success. Our focus is on developing each student&rsquo;s skills and attributes, using creative and critical thinking to help them thrive in an increasingly complex world. We want them to be adventurous beyond the curriculum, empowered to achieve more than they thought possible.\&quot;}},{\&quot;id\&quot;:\&quot;t-O86382ey\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;A Plympton International Student is a young person of resilience and self-motivation towards excellence who displays a high level of intercultural understanding and takes pride in language/bilingual education and is ready to engage proactively in our globally connected world.\&quot;}},{\&quot;id\&quot;:\&quot;pXFYAng_Nt\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;Amy Whyte -&amp;nbsp;&lt;/b&gt;&lt;b&gt;Principal&lt;/b&gt;\&quot;}},{\&quot;id\&quot;:\&quot;TJ92-ljAcY\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;font size=\\\&quot;5\\\&quot;&gt;&lt;b&gt;Primary Years: Reception to Year 6&lt;/b&gt;&lt;/font&gt;\&quot;,\&quot;level\&quot;:2}},{\&quot;id\&quot;:\&quot;e6kfwu8vyk\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;Our Primary Years provide a stimulating and caring learning environment. We are focussed on the academic and social learning needs of children in all areas of the curriculum.&lt;/b&gt;\&quot;,\&quot;level\&quot;:5}},{\&quot;id\&quot;:\&quot;3KyPOL7LiQ\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our support begins even before children start school. We work in partnership with local preschools to connect the students with Plympton International College staff. This enables children and teachers to begin building a relationship, making the transition to school a seamless and positive experience.\&quot;}},{\&quot;id\&quot;:\&quot;-mk6nGgBbG\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;Our facilities and curriculum for Primary Years&lt;/b&gt;\&quot;,\&quot;level\&quot;:5}},{\&quot;id\&quot;:\&quot;90MXZ_6flq\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;A spacious and well-equipped Primary Years-only play areaExperienced and caring classroom teachers&lsquo;Buddy&rsquo; programs with students and teachers across the campusAccess to facilities such as Science, Home Economics and the Gymnasium to enhance learningStudy in all areas of the curriculum &ndash; English, Mathematics, Technologies