        &quot;name&quot;: &quot;Henley Beach Primary School&quot;,
        &quot;content_blocks&quot;: &quot;{\&quot;time\&quot;:1687398826664,\&quot;blocks\&quot;:[{\&quot;id\&quot;:\&quot;UkpbtjcjNd\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;&lt;font size=\\\&quot;6\\\&quot;&gt;WELCOME TO HENLEY BEACH PRIMARY&lt;/font&gt;&lt;/b&gt;\&quot;,\&quot;level\&quot;:2}},{\&quot;id\&quot;:\&quot;NY5mHVdTod\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Henley Beach Primary School (Reception to Year 6) has a strong sense of community in which parents, staff and students work together to ensure our school environment is focused on every child being successful and connected to their learning.  We acknowledge Henley Beach Primary School is located on the traditional lands of the Kaurna people and we respect their spiritual relationship with their country. We also acknowledge the Kaurna people as the custodians of the Adelaide region and that their cultural and heritage beliefs are still as important to the living Kaurna people today.&amp;nbsp;\&quot;}},{\&quot;id\&quot;:\&quot;i7NQ3U0YdS\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;&lt;font size=\\\&quot;6\\\&quot;&gt;PRINCIPAL&#039;S WELCOME&lt;/font&gt;&lt;/b&gt;\&quot;,\&quot;level\&quot;:2}},{\&quot;id\&quot;:\&quot;_PxoWAUoWT\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;At Henley Beach Primary School we celebrate and value a strong sense of community in which families, staff and students work together to maintain a friendly and welcoming environment. High expectations are held for all students at Henley Beach.\&quot;}},{\&quot;id\&quot;:\&quot;TBCTQ5RDV5\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;The educational opportunities here are stimulating and challenging with an emphasis on literacy, numeracy and students developing the dispositions to be successful learners. Progress towards these priorities sits alongside the implementation of the Australian Curriculum.\&quot;}},{\&quot;id\&quot;:\&quot;N5Qivfj0C7\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Children access specialist lessons in the areas of Physical Education, Science, Italian, Performing Arts and Technologies. Students also have the opportunity to participate in a range of extra-curricular opportunities including camps, instrumental music lessons, sporting activities and environmental and sustainability programs. Teaching and learning at Henley Beach emphasises the development of the whole child; covering their emotional, academic, physical and social wellbeing. These areas are underpinned by our school values, they being: Care. Respect. Safety. Doing your best.\&quot;}},{\&quot;id\&quot;:\&quot;3vCcLlMEjq\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;OUR VALUES&lt;/b&gt;&amp;nbsp;\&quot;}},{\&quot;id\&quot;:\&quot;5pgFj1eQN_\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Safety, Respect, Care, Best\&quot;}},{\&quot;id\&quot;:\&quot;9rCuHjBe5m\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Henley Beach Primary School is a Reception to year 6 school and also offers a special class for children R &ndash; 2 who have a learning disability. Our special small class provides students their own play area, ICT devices, kitchenette and sensory room.\&quot;}},{\&quot;id\&quot;:\&quot;WfKZowB6S7\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;ATTENDANCE&lt;/b&gt;\&quot;,\&quot;level\&quot;:4}},{\&quot;id\&quot;:\&quot;joHZk_stFf\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Regular attendance and punctuality is an essential aspect for your child&rsquo;s development. Once enrolled, children are required to attend school each day. If children arrive at school late, they need to be signed in at the School Front Office. Letters/notes of explanation are required, by law to cover all occasions when your child is not at school &ndash; full day and partial day.\&quot;}},{\&quot;id\&quot;:\&quot;kt4T5qtKcm\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Ring 8356 2117 or SMS 0476 857 370 if your child is going to be absent from school. If we haven&rsquo;t heard we will need to contact you via SMS to find out why your child is not at school.\&quot;}},{\&quot;id\&quot;:\&quot;XsO1PaYEmz\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;COMMUNICATION&lt;/b&gt;\&quot;,\&quot;level\&quot;:4}},{\&quot;id\&quot;:\&quot;W_yIFfKf5_\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;School newsletters are distributed via Skoolbag to families fortnightly. The newsletter is a very important link between the school, the home and the community. Skoolbag (an app based platform) is used to communicate a variety information to the school community, including the distribution of the school newsletter. Where needed, important reminders and information regarding attendance are communicated via our SMS system. All parents are encouraged to register their mobile phone numbers with the school office to ensure they receive important information.\&quot;}},{\&quot;id\&quot;:\&quot;sMnZlJhvH3\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Teachers utilise the online communication tool See Saw for communicating with families, including class events, reminders, activities etc.\&quot;}},{\&quot;id\&quot;:\&quot;GsZ1MscGYP\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;‚ÄãMOBILE PHONES&lt;/b&gt;\&quot;,\&quot;level\&quot;:4}},{\&quot;id\&quot;:\&quot;Ddvi20crSW\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Students in Reception to year 6 are not permitted to use mobile phones while at school. Mobile phones are collected at the beginning of each day and held in the front office.\&quot;}},{\&quot;id\&quot;:\&quot;d2cG9toVey\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;CLASS&lt;/b&gt; &lt;b&gt;STRUCTURE&lt;/b&gt;\&quot;,\&quot;level\&quot;:4}},{\&quot;id\&quot;:\&quot;tp3zMf_Dio\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Class structures vary from year to year and are influenced by the enrolment numbers in year level cohorts and the total number of students across the school. The development of class structures is reviewed prior to each school year. Currently Henley Beach PS has predominantly single year level classes with some composite classes. A composite class is composed of 2 year levels and can occur if overall enrolment numbers do not allow a single year level class to be formed. At Henley Beach Primary School we make every effort to cater for the individual needs of children whether in a single year level or multi-age classes. All classes, regardless of their structure, are developed in a way to ensure they are balanced in regards to overall class size, gender distribution and academic achievement.\&quot;}},{\&quot;id\&quot;:\&quot;xmFAu2HtaU\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our special class is composed of children from Reception to year 2.&amp;nbsp;These children have the opportunity to interact with their peers in mainstream classes as well as access their own individual learning programs. Our special class provides students their own play area, ICT devices, kitchenette and sensory room\&quot;}},{\&quot;id\&quot;:\&quot;MKUowg6NCh\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;LEARNING BENCHMARKS&lt;/b&gt;\&quot;,\&quot;level\&quot;:4}},{\&quot;id\&quot;:\&quot;99VCRJKYMo\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Student progress and achievement is monitored consistently by their teacher. Regardless of a student&rsquo;s starting point, our focus is on all children achieving progress in their learning. To support this, a range of key benchmarks are used including the Department for Education&rsquo;s Standard for Education Achievement and the documented achievement standards for each learning area in the Australian Curriculum.\&quot;}}],\&quot;version\&quot;:\&quot;2.27.0\&quot;}&quot;,
