        &quot;content_blocks&quot;: &quot;{\&quot;time\&quot;:1687401933177,\&quot;blocks\&quot;:[{\&quot;id\&quot;:\&quot;wTewrUgkCk\&quot;,\&quot;type\&quot;:\&quot;header\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;&lt;b&gt;&lt;font size=\\\&quot;6\\\&quot;&gt;PRINCIPAL&rsquo;S WELCOME&lt;/font&gt;&lt;/b&gt;\&quot;,\&quot;level\&quot;:2}},{\&quot;id\&quot;:\&quot;sG4dSSMDf_\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our Motto, Fac Omnia Bene, meaning Do All Things Well, is reflected in our aim to develop world class learners who aspire to be curious, courageous and engaged citizens.\&quot;}},{\&quot;id\&quot;:\&quot;zG4beuUQLx\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;As you walk through the entrance of Brighton Secondary School into the original 1952 building, you cannot help but admire the rich history and foundations of our school, a school that is embedded within community and one that is a locus of community-building. While we draw on and learn from the past, our focus is very much on educating for now and the future. We challenge minds and equip our young people with the skills and dispositions, knowledge and confidence necessary to contribute as active, engaged citizens of their local and global context.\&quot;}},{\&quot;id\&quot;:\&quot;T55qviKro4\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our mission for excellence and equity is underpinned by our ASPIRE values of:\&quot;}},{\&quot;id\&quot;:\&quot;RoRmuBCknt\&quot;,\&quot;type\&quot;:\&quot;image\&quot;,\&quot;data\&quot;:{\&quot;file\&quot;:{\&quot;url\&quot;:\&quot;http://localhost:8000/storage/uploads/image/edspark-image-e84434224d2e0168fc44b7baf738cb53.jpeg\&quot;},\&quot;caption\&quot;:\&quot;Our Aspire Value\&quot;,\&quot;withBorder\&quot;:false,\&quot;stretched\&quot;:false,\&quot;withBackground\&quot;:false}},{\&quot;id\&quot;:\&quot;UstS93irO7\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;We are a school with a strong academic focus and a history of outstanding achievement: Our facilities are second to none and our teaching and learning is informed by this tradition and is embedded in strong disciplinary expertise across the curriculum.\&quot;}},{\&quot;id\&quot;:\&quot;ZtKfW3wHJy\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;We also continue to innovate and grow our practice and programs to meet the current and future needs of young people. Our academic success is born out of an unerring focus on&amp;nbsp;progress&amp;nbsp;for each child, and the development of transdisciplinary skills, such as critical thinking, communication, collaboration and problem-solving. This applies both to students and to staff, who are also reflective learners.\&quot;}},{\&quot;id\&quot;:\&quot;md3J4dSv7K\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Schools are much more than just the teaching and learning that takes place in class. Fundamentally they are about relationships and connections. It is my mission to ensure that each child finds their place, and is known, valued and understood by their teachers and peers.\&quot;}},{\&quot;id\&quot;:\&quot;J2O5naMQwv\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;At Brighton Secondary School, our size provides a guarantee of diversity &ndash; everyone can find their niche and their people through the full range of outstanding academic and co-curricular programs. Students have opportunities and experiences that allow them to excel in the full breadth of learning and enrichment activities, be they in class or participating in international programs, tours, camps, the music or debating programs, or our extremely successful sports teams, and much more.\&quot;}},{\&quot;id\&quot;:\&quot;zezYhpKUOc\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;We understand the tangible benefits of internationalisation. We celebrate inclusivity in every sense of the word. We are enriched by the differences individuals bring to our community. We are a school of choice for the International Student Program.\&quot;}},{\&quot;id\&quot;:\&quot;RHOEIUmCtd\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Our sister schools relationships in Toyodai Himeji Japan and curriculum-based international tours provide students with perspectives and experiences well beyond the school gates.\&quot;}},{\&quot;id\&quot;:\&quot;UFm7rtnuNH\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;I invite you to come on a tour of the school &ndash; to see us in action. Gain a sense of the learning and relationships that exist in every classroom, experience our culture, and observe the pride we have for our school and for all those who pass through its doors.\&quot;}},{\&quot;id\&quot;:\&quot;5VFUqWDdyh\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Tony Lunniss\&quot;}},{\&quot;id\&quot;:\&quot;RSwjw70ZB4\&quot;,\&quot;type\&quot;:\&quot;paragraph\&quot;,\&quot;data\&quot;:{\&quot;text\&quot;:\&quot;Principal\&quot;}}],\&quot;version\&quot;:\&quot;2.27.0\&quot;}&quot;,
